import React, { Component } from 'react';
import './App.css';
import './css/index.css';
import AppContent from './components/app-content';

class App extends Component {
  constructor() {
    super();
    this.state = {
      userinfo: 0,
    };
  }
  render() {
    return <AppContent userinfo={this.state.userInfo} />;
  }
}

export default App;
